import{_ as t,c as o,o as a,aM as n}from"./chunks/framework.DAyGILei.js";const p=JSON.parse('{"title":"Google Authenticator reset","description":"Guide on Google Authenticator key reset.","frontmatter":{"title":"Google Authenticator reset","category":"Guides","permalink":"/do-science/guides/google-authenticator-reset","outline":1,"description":"Guide on Google Authenticator key reset."},"headers":[],"relativePath":"do-science/guides/access-guides/reset-gauth.md","filePath":"do-science/guides/access-guides/reset-gauth.md"}'),r={name:"do-science/guides/access-guides/reset-gauth.md"};function i(l,e,s,c,u,d){return a(),o("div",null,[...e[0]||(e[0]=[n('<h1 id="google-authenticator-key-reset" tabindex="-1">Google Authenticator key reset <a class="header-anchor" href="#google-authenticator-key-reset" aria-label="Permalink to &quot;Google Authenticator key reset&quot;">​</a></h1><p><strong>This guide describes how to reset your Google Authenticator key that you use to access your HUNT Cloud VPN.</strong></p><nav class="table-of-contents"><ul><li><a href="#_1-requirement">1. Requirement</a></li><li><a href="#_2-install-google-authenticator">2. Install Google Authenticator</a></li><li><a href="#_3-setup-the-app-and-add-a-new-account">3. Setup the app and add a new account</a></li><li><a href="#_4-connect-to-your-lab">4. Connect to your lab</a></li></ul></nav><div class="tip custom-block"><p class="custom-block-title">New or lost phone?</p><p>Order a new Google Authenticator key in our do-science <a href="/do-science/service-desk/#google-authenticator-key-reset">service desk</a>.</p></div><h2 id="_1-requirement" tabindex="-1">1. Requirement <a class="header-anchor" href="#_1-requirement" aria-label="Permalink to &quot;1. Requirement&quot;">​</a></h2><p>The new Google Authenticator key sent over Signal from HUNT Cloud.</p><h2 id="_2-install-google-authenticator" tabindex="-1">2. Install Google Authenticator <a class="header-anchor" href="#_2-install-google-authenticator" aria-label="Permalink to &quot;2. Install Google Authenticator&quot;">​</a></h2><p>Search for <strong><code>Google Authenticator</code></strong> in the Android or iOS app stores, or use the links below.</p><ul><li><a href="https://apps.apple.com/us/app/google-authenticator/id388497605" target="_blank" rel="noreferrer">Download and install for iOS here</a></li><li><a href="https://play.google.com/store/apps/details?id=com.google.android.apps.authenticator2&amp;hl=en" target="_blank" rel="noreferrer">Download and install for Android here</a></li></ul><h2 id="_3-setup-the-app-and-add-a-new-account" tabindex="-1">3. Setup the app and add a new account <a class="header-anchor" href="#_3-setup-the-app-and-add-a-new-account" aria-label="Permalink to &quot;3. Setup the app and add a new account&quot;">​</a></h2><ol><li>Start the Google Authenticator app.</li><li>Tap <em>Begin setup</em> (first time setup) or <em>Add an account</em> (additional accounts).</li><li>Select <em>Enter a provided key</em>.</li><li>Enter <strong><code>HUNT CLOUD VPN</code></strong> as the account name.</li><li>Enter the Google Authenticator key sent to you over Signal.</li><li>Make sure <em>Time based</em> is selected.</li><li>Tap <em>Add</em> to finish the setup of the new account.</li></ol><div class="warning custom-block"><p class="custom-block-title">Expect this one-time verification</p><p>A 6 digit <strong><code>verification code</code></strong> that refreshes ever 30 seconds in the Google Authenticator app on your phone.</p></div><h2 id="_4-connect-to-your-lab" tabindex="-1">4. Connect to your lab <a class="header-anchor" href="#_4-connect-to-your-lab" aria-label="Permalink to &quot;4. Connect to your lab&quot;">​</a></h2><p>Verify a successful setup by connecting your VPN and access your lab. <a href="/contact">Contact us</a> if you are unable to connect after the key reset.</p>',14)])])}const g=t(r,[["render",i]]);export{p as __pageData,g as default};
